from random import choice, randint
class Animal(object):
    
    _animal_count = 0
    
    def __init__(self, name, species, color):
        self._name = name
        self._species = species
        self._color = color
        
        Animal._animal_count += 1
        
    def get_name(self):
        return self._name
    
    def get_species(self):
        return self._species
    
    def get_color(self):
        return self._color
    
    def animal_count(self):
        return Animal._animal_count
    
    #called when we say a == b
    def __eq__(self, other):
        try:
            return self._name == other.get_name() and self._species == other.get_species() and self._color == other.get_color()
        except AttributeError:
            return False
        
    #called when we say a != b
    def __ne__(self, other):
        return not (self == other)
    
    #called when we say a < b
    def __lt__(self, other):
        try:
            self_str = "{0} {1} {2}".format(self._name, self._species, self._species)
            other_str = "{0} {1} {2}".format(other.get_name(), other.get_species(), other.get_color())
            return self_str < other_str
        except AttributeError:
            return NotImplemented
        
    #called when we say a <= b
    def __le__(self, other):
        try:
            return self < other or self == other
        except TypeError:
            return NotImplemented
        
    #called when we say a > b
    def __gt__(self, other):
        try:
            return not (self <= other)
        except TypeError:
            return NotImplemented
        
    #called when we say a >= b
    def __ge__(self, other):
        try:
            return not (self < other)
        except TypeError:
            return NotImplemented
    
    def __str__(self):
        return "Animal: Name={0}, Species={1}, Color={2}".format(self._name, self._species, self._color)
    
    def __repr__(self):
        return "Animal({0}, {1}, {2})".format(repr(self._name), repr(self._species), repr(self._color))
    
